INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 4, 0.0, 4, 24015, 0.0, 1);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 4, 0.0, 1, 24016, 4.0, 2);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 4, 0.0, 4, 24017, 0.0, 3);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 1, 0.0, 2, 24018, 5.2, 4);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 5, 0.0, 6, 24019, 4.2, 5);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 2, 0.0, 2, 24020, 0.0, 6);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 1, 0.0, 6, 24021, 6.4, 7);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 2, 0.0, 2, 24022, 0.0, 8);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 6, 0.0, 3, 24023, 10.08, 9);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 1, 0.0, 2, 24024, 5.0, 10);
INSERT INTO `v1_5985dde530e551c2c3a91c065240101b86bd778aeb393f586a587e39f8612fc8` VALUES (0.0, "2019/07/31 12:00:00", 24, "カオリ（サマー）", 110501, "2030/12/17 14:59:59", 10021, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 2, 0.0, 2, 24025, 0.0, 11);
